import React from 'react'
import * as productList from './../Overview/data/productList.json'

const Product = ({match}) => {
    const products = productList.default;

    products = products.find((product) => product.sku === match.params.sku);
    return (
        <h1>{match.params.sku}</h1>
    )
}

export default Product
